(2, 'African Grace', 'african-grace', 'A vibrant and stunning painting of an African woman in a traditional outfit with a warm smile.', '\"African Grace\" captures the essence of the African culture and beauty in a stunning portrait of a woman dressed in traditional attire, smiling warmly and radiating grace. The painting exudes joy, pride and confidence, making it a perfect addition to any space.', 30.00, '30', 'AGS1002', 'approved', 0, 100, '1675494920.jpg', NULL, 2, 7, '2023-02-04 04:15:20', '2023-02-10 05:37:55', NULL),
(3, 'Family Bond', 'family-bond', 'A heart-warming scene of a baboon (replaced)cuddling with its young one.', 'A breath-taking illustration of the strong bond between a parent and child in the wild. The baboon or chimpanzee cradles its young one in its arms, showcasing the love and protection in their family. The vivid colors and details of the African savanna add to the beauty of this magnificent piece.', 30.00, '30', 'FBS1003', 'approved', 0, 100, '1675495310.jpg', NULL, 2, 5, '2023-02-04 04:21:50', '2023-02-07 08:06:28', NULL),
(4, 'Bird on a Branch', 'bird-on-a-branch', 'A serene bird perched on a tree branch surrounded by leaves.', 'A peaceful bird soars on a tree branch surrounded by lush green leaves. This breath-taking scene depicts nature in its purest form, reminding us of the beauty that surrounds us. Take a moment to appreciate this gorgeous work of art and bring a touch of nature to your home.', 30.00, '30', 'BBS2001', 'approved', 1, 100, '1675495559.jpg', NULL, 1, 4, '2023-02-04 04:25:59', '2023-02-04 04:25:59', NULL),
(5, 'Ride Along', 'ride-along', 'A couple enjoys a serene ride on their bicycle in a rural village', ' A man and a woman on a bicycle in a peaceful rural village, surrounded by greenery and calm waters. The couple takes in the beautiful scenery as they enjoy their ride along the quiet road. The cool and soothing bluish tint in the image adds to the serene atmosphere of the painting.', 30.00, '30', 'RAS2002', 'approved', 0, 100, '1675495745.jpg', NULL, 1, 3, '2023-02-04 04:29:05', '2023-02-10 05:38:28', NULL),
(6, 'African', 'african', 'Discover Africa with our beautiful and colorful map.', ' Immerse yourself in the beauty of Africa with our stunning \"African Atlas\" painting. Featuring a detailed map of the continent in different colors, this painting is perfect for adding a touch of culture to any space. Get your own piece of Africa today!', 30.00, '30', 'AAS2003', 'approved', 1, 100, '1675495952.jpg', NULL, 1, 3, '2023-02-04 04:32:32', '2023-02-07 04:35:36', NULL),
(7, 'Majestic King', 'majestic-king', 'A stunning depiction of a powerful lion, the king of the jungle, with a rich brown coat against a stark black background.', 'This breathtaking painting showcases the grandeur of a lion, the undisputed ruler of the African savannah. With its magnificent mane, piercing gaze, and captivating brown coat, this painting captures the essence of the king of the jungle. Against a striking black background, the lion is showcased in all its splendor, making for an eye-catching and awe-inspiring piece of art.', 30.00, '30', 'MKS3001', 'approved', 1, 100, '1675496152.jpg', NULL, 4, 7, '2023-02-04 04:35:52', '2023-02-04 04:35:52', NULL),
(8, 'Sculpture Make', 'sculpture-make', 'A beautifully crafted sculpture standing out on a deep blue background, capturing attention and admiration.', 'A stunning sculpture with intricate details and captivating form, set against a rich and vivid blue background. The piece is sure to draw the eye and evoke feelings of wonder and appreciation for the artist\'s skill and creativity. Whether displayed in a home, office, or gallery, this piece of art is sure to be a conversation starter and a source of ongoing inspiration and enjoyment', 30.00, '30', 'SMS3002', 'approved', 0, 100, '1675496605.jpg', NULL, 4, 5, '2023-02-04 04:43:25', '2023-02-04 04:43:25', NULL),
(9, 'Sisters in Blue', 'sisters-in-blue', 'A beautiful portrait of two ladies heads, painted in blue hues with swirling accents.', '\"Sisters in Blue\" is a captivating painting that depicts two beautiful ladies, each with their own unique features, painted in stunning blue hues with swirling accents. This artwork is perfect for those who appreciate the elegance and grace of portraiture, as well as the dramatic impact of blue color. The painting is sure to add a touch of sophistication and beauty to any room in your home or office.', 30.00, '30', 'SBS3003', 'approved', 0, 100, '1675496761.jpg', NULL, 4, 3, '2023-02-04 04:46:01', '2023-02-04 04:46:01', NULL),
(10, 'Motherly Love', 'motherly-love', 'A beautiful depiction of a mother\'s love for her child, capturing their tender moment of joy.', 'A heart warming painting of a woman holding her child close, both of them smiling with love in their eyes. The woman is pointing a finger at something unknown, but her smile and the look in her eyes tell us she is filled with happiness. This painting is a perfect reminder of the love and bond between a mother and her child.', 30.00, '30', 'MLS4001', 'approved', 1, 100, '1675496971.jpg', NULL, 3, 7, '2023-02-04 04:49:31', '2023-02-04 04:49:31', NULL),
(11, 'Basket Bearers', 'basket-bearers', 'Traditional women carry baskets on their heads in a beautiful grassland setting.', 'Women, adorned in traditional clothing, walk gracefully across a stunning grassland landscape, balancing baskets of food on their heads. The intricate details of the baskets and the grace of the women create a captivating and peaceful scene.', 30.00, '30', 'BBS5001', 'approved', 1, 100, '1675497217.jpg', NULL, 3, 6, '2023-02-04 04:53:37', '2023-02-04 04:53:37', NULL),
(12, 'Moonlit River', 'moonlit-river', 'A stunning painting of a river surrounded by trees and blue clouds with a moon shining above.', 'A peaceful and serene painting of a moonlit river with lush trees surrounding it and a beautiful blue clouded sky overhead. The shining moon adds a touch of magic to this already stunning piece of art. Experience the tranquillity of nature from the comfort of your own home with this stunning piece.', 30.00, '30', 'MLS4002', 'approved', 0, 100, '1675497469.jpg', NULL, 3, 2, '2023-02-04 04:57:49', '2023-02-10 05:38:22', NULL),
(13, 'African Glimmer', 'african-glimmer', 'A beautiful depiction of an African child with a unique eye design.', 'This stunning painting captures the essence of African culture with its subject, an African child, adorned in traditional attire and painted with a unique eye design. The dark surroundings contrast with the bright, shining spirit of the child, creating a mesmerizing and thought-provoking piece.', 30.00, '30', 'AGS4003', 'approved', 0, 100, '1675498644.jpg', NULL, 3, 7, '2023-02-04 05:17:24', '2023-02-10 05:38:11', NULL),
(14, 'Spiral School', 'spiral-school', 'A mesmerizing spiral design with tiny fish swimming in the currents.', 'Admire the intricate details and mesmerizing movement of tiny fish swimming in the spiral currents. The intricate design is both calming and captivating, making it a unique piece for any art collection.', 30.00, '30', 'SSS5002', 'approved', 1, 100, '1675499248.jpg', NULL, 5, 1, '2023-02-04 05:27:28', '2023-02-09 15:32:01', NULL),
(15, 'Elephant Family', 'elephant-family', 'Admire the beauty of nature with this stunning painting of an elephant and its calf in the lush grasses.', 'Experience the bond between a mother and her child with this breath-taking painting of an elephant and her young one roaming in the grasses. Captured in stunning detail, this piece showcases the majesty of the African savannah and the loving bond between a mother and her calf.', 30.00, '300', 'EFS5003', 'approved', 0, 100, '1675499484.jpg', NULL, 5, 4, '2023-02-04 05:31:24', '2023-02-09 15:20:04', NULL),
(30, ' Boy with Saucepan Hat', 'boy-with-saucepan-hat', 'A heartwarming painting of a young boy with a bright smile wearing a saucepan as a hat, painted in vivid colors.', '\"Smiling Boy with Saucepan Hat\" is a cheerful and whimsical painting that captures the playful and imaginative spirit of childhood. The painting features a young boy with a broad smile on his face, proudly wearing a saucepan as a hat. The colors in the painting are bright and vivid, with bold brushstrokes that give the image a lively and energetic feel. The boy\'s eyes are bright and twinkling, and his smile radiates pure joy and happiness. This painting is a celebration of childhood innocence and the unbridled imagination of youth, and is sure to bring a smile to the face of anyone who sees it.', 30.00, '30', 'RK800GR', 'approved', 1, 100, '1676049961.jpg', NULL, 5, 7, '2023-02-10 17:26:02', '2023-02-20 04:30:50', 3),
(31, 'Chromatic Fusion', 'chromatic-fusion', 'A dynamic abstract painting featuring an array of colors aligned vertically.', 'Chromatic Fusion is a captivating abstract painting that blends a multitude of colors in vertical lines. The painting evokes a sense of energy and movement, with the colors appearing to blend and flow into one another. The dynamic composition is both bold and sophisticated, making it an ideal centerpiece for any modern space.', 30.00, '30', 'RK800GR', 'approved', 0, 100, '1676279498.jpg', NULL, 2, 4, '2023-02-13 09:11:39', '2023-02-20 04:29:09', 3),
(32, 'Chromatic Dreams', 'chromatic-dreams', 'Vibrant and mesmerizing, these abstract art pieces burst with a kaleidoscope of colors that evoke feelings of joy, energy, and creative expression.', 'Chromatic Dreams is a collection of abstract art pieces that captures the essence of vibrant hues, bold strokes, and imaginative designs. Each piece showcases a kaleidoscope of colors that blend, merge, and clash in a beautiful dance of light and shadow. From fiery reds to cool blues, from sunny yellows to earthy greens, the colors in this collection evoke a wide range of emotions and moods, from joy and excitement to calmness and serenity. Whether you\'re looking to add a pop of color to your living room, office, or any other space, Chromatic Dreams has a piece that will capture your imagination and make your heart sing.', 30.00, '30', 'RK800GR', 'approved', 0, 100, '1676279568.jpg', NULL, 2, 4, '2023-02-13 09:12:48', '2023-02-20 04:25:10', 3),
