(148, 'Dual Face Illusion', 'dual-face-illusion', ' This painting is an optical illusion featuring a face that appears to change direction depending on how you look at it.', ' \"Dual Face Illusion\" is a mesmerizing painting that uses an optical illusion to create the impression of a face that is simultaneously looking left and right. The painting is predominantly red, with shades ranging from bright crimson to deep maroon. The face itself is rendered in shades of black and gray, with stark white eyes and a neutral expression that seems to follow you around the room. As you move from side to side, the direction of the face appears to change, creating a captivating visual effect that is both intriguing and slightly disorienting.', 30.00, '30', 'S5d2004', 'approved', 0, 100, '1677179447.jpg', NULL, 5, 4, '2023-02-23 19:10:48', '2023-02-23 19:10:48', 3),
(149, 'Veiled Lady', 'veiled-lady', 'A portrait painting of a young lady with a delicate veil draped over her head.', 'The Veiled Lady is a beautiful and intricate portrait painting that depicts a young lady wearing a veil over her head. The veil is made of a delicate fabric and is draped in such a way that it accentuates the woman\'s features while also partially concealing her face. The woman has a serene expression, with her eyes gazing off into the distance as if lost in thought. The background of the painting is a soft, muted color that adds to the overall sense of peacefulness and tranquility. The Veiled Lady is a stunning work of art that captures the essence of femininity and beauty.', 30.00, '30', 'S4D2004', 'approved', 0, 100, '1677181198.jpg', NULL, 3, 7, '2023-02-23 19:39:58', '2023-02-23 19:39:58', 3),
(150, ' Ancient King', 'ancient-king', 'A painting of an ancient leader.', 'This painting depicts an ancient leader, standing tall and proud, with a commanding presence. He is depicted wearing traditional clothing and regalia, with intricate patterns and details that hint at his status and power. His expression is stern and unyielding, suggesting a man who is used to getting his way and will not be easily swayed. The colors used in the painting are rich and vibrant, with deep blues and reds dominating the scene, giving a sense of majesty and importance. The painting is done in a realistic style, with careful attention paid to the details of the leader\'s clothing, facial features, and surroundings.', 30.00, '30', 'S5D2005', 'approved', 0, 100, '1677181427.jpg', NULL, 5, 3, '2023-02-23 19:43:47', '2023-02-23 19:43:47', 3),
(151, 'Lady with a Veil', 'lady-with-a-veil', ' A portrait painting of a young lady wearing a veil on her head.', ' Lady with a Veil is a portrait painting of a young woman who is wearing a light-colored veil on her head. The painting is executed in a realistic style, with careful attention paid to the details of the subject\'s features, clothing, and the texture of the veil. The colors used in the painting are muted and subdued, creating a tranquil and serene atmosphere. The subject\'s expression is calm and introspective, adding to the overall peaceful feeling of the painting. The veil partially obscures the subject\'s face, giving the painting a sense of mystery and intrigue. The overall effect is one of quiet elegance and understated beauty.', 30.00, '30', 'S4D2005', 'approved', 0, 100, '1677181532.jpg', NULL, 3, 3, '2023-02-23 19:45:32', '2023-02-23 19:45:32', 3),
(152, 'Hair Weaving', 'hair-weaving', 'A painting depicting a lady weaving another person\'s hair.', 'The painting shows a woman sitting behind another woman, who is sitting on a stool. The woman behind is weaving the other woman\'s hair, which is parted into sections. The weaver\'s hands are shown in motion, holding strands of hair and interlacing them. The weaver is wearing a yellow dress with green embroidery, and her hair is tied in a bun. The other woman has her eyes closed and is wearing a pink dress with white polka dots. The background is a mix of muted blue and green colors, suggesting a serene atmosphere.', 30.00, '30', 'S5D1006', 'approved', 0, 100, '1677181643.jpg', NULL, 5, 3, '2023-02-23 19:47:23', '2023-02-23 19:47:23', 3),
(153, ' Joyful Brush Strokes', 'joyful-brush-strokes', 'A painting of a man with a big smile on his face holding a paintbrush, with colorful brush strokes surrounding him.', ' Joyful Brush Strokes is a painting that captures the essence of happiness and creativity. In the center of the painting is a man with a big smile on his face, holding a paintbrush and seemingly lost in his work. Surrounding him are bold and colorful brush strokes, which suggest a sense of movement and energy. The painting is a celebration of the joy that comes from being in a creative state, and it encourages viewers to embrace their own artistic impulses and express themselves freely.', 30.00, '30', 'S4D2006', 'approved', 0, 100, '1677181787.jpg', NULL, 3, 7, '2023-02-23 19:49:47', '2023-02-23 19:49:47', 3),
(154, 'Mother and Child', 'mother-and-child', 'A woman carrying her child, with long flowing hair, stands in the foreground of the painting. The background is blurred, suggesting movement and activity. The color palette is warm and earthy, with shades of brown, orange, and yellow dominating the scene.', ' \"Mother and Child\" is a heartwarming painting that captures the tenderness and warmth of a mother\'s love for her child. The woman in the painting is depicted with long, flowing hair that extends down her back and shoulders, emphasizing her femininity and nurturing nature. She carries her child in her arms, cradling him or her close to her chest. The child\'s face is not visible, but we can see its tiny hands clutching onto the mother\'s clothing.\n\nThe background of the painting is blurry, suggesting movement and activity, and adding a sense of depth to the scene. The color palette is warm and earthy, with shades of brown, orange, and yellow dominating the foreground. The use of these colors creates a sense of comfort and security, and reinforces the theme of maternal love and protection. Overall, \"Mother and Child\" is a beautiful painting that captures the bond between a mother and her child in a simple yet powerful way.', 30.00, '30', 'S5D2006', 'approved', 0, 100, '1677181860.jpg', NULL, 5, 7, '2023-02-23 19:51:00', '2023-02-23 19:51:00', 3),
(155, 'Multicolored Elephant Head', 'multicolored-elephant-head', 'A painting of an elephant\'s head, depicted in multiple colors.', 'This painting features an intricate depiction of an elephant\'s head, with a focus on the animal\'s majestic trunk and tusks. The elephant\'s eyes are large and expressive, and the artist has used a variety of colors to create a sense of depth and dimensionality. The brushstrokes are bold and expressive, giving the painting a lively and energetic feel. The overall effect is one of vibrancy and vitality, capturing the essence of this magnificent animal in a unique and captivating way.', 30.00, '30', 'S4D2007', 'approved', 0, 100, '1677182047.jpg', NULL, 3, 3, '2023-02-23 19:54:07', '2023-02-23 19:54:07', 3),
(156, 'Baboon with Young One', 'baboon-with-young-one', 'A painting of a baboon with its young one.', 'This painting depicts a baboon with its young one. The mother baboon is shown sitting on a rock, looking protectively at her baby. The baby baboon is clinging to its mother, looking up at her with a curious expression. The painting is done in warm earthy tones, with the baboons\' fur rendered in shades of brown and orange. The background is a mix of greens and browns, suggesting a natural environment. The overall effect is one of tenderness and maternal love.', 30.00, '30', 'S5D2007', 'approved', 0, 100, '1677182616.jpg', NULL, 5, 2, '2023-02-23 20:03:36', '2023-02-23 20:03:36', 3),
(157, 'Joyful Laughter', 'joyful-laughter', 'A painting of a young boy with a big smile on his face and his mouth wide open as if he is laughing out loud.', 'This painting captures the joy of a young boy as he bursts out laughing. The boy\'s face is filled with happiness, his eyes are crinkled up, and his mouth is open wide. The colors used in the painting are bright and vibrant, adding to the sense of joy and energy. The background is blurred, giving the impression that the boy is laughing so hard that the world around him has become a blur. Overall, this painting is a celebration of the pure and unbridled happiness that can come from a good laugh.', 30.00, '30', 'S4D2007', 'approved', 0, 100, '1677182672.jpg', NULL, 3, 7, '2023-02-23 20:04:32', '2023-02-23 20:04:32', 3),
(158, 'Woman Smiling', 'woman-smiling', 'This is a painting of a woman\'s face, specifically her upper body and face, smiling. The painting is done in a semi-realistic style, with attention paid to the details of the woman\'s features, such as her eyes, nose, and mouth.', ' \"Woman Smiling\" is a painting that captures the joy and happiness of a woman\'s smile. The painting depicts a close-up of the woman\'s upper body and face, with her head tilted slightly to one side and her eyes looking directly at the viewer. The woman\'s smile is wide and genuine, and her eyes are bright with happiness.\n\nThe painting is done in a semi-realistic style, with attention paid to the details of the woman\'s features. Her hair is painted in shades of brown and gold, and her skin has a warm, glowing tone. The colors used in the painting are primarily warm and inviting, with shades of pink and orange used to highlight the woman\'s features and bring attention to her smile. The background of the painting is simple, with a muted blue color that helps to emphasize the woman\'s face.', 30.00, '30', 'S4D2008', 'approved', 0, 100, '1677182836.jpg', NULL, 3, 3, '2023-02-23 20:07:17', '2023-02-23 20:07:17', 3),
(159, 'Desert Tourists', 'desert-tourists', 'A painting depicting a group of tourists exploring a desert landscape.', 'Desert Tourists is a vibrant and colorful painting that showcases a group of tourists walking through a vast, sandy desert landscape. The tourists are dressed in casual clothing, and some of them are carrying backpacks or water bottles. The painting captures the beauty of the desert, with its rolling sand dunes and towering rock formations in the distance. The colors in the painting are warm and inviting, with shades of orange, yellow, and brown dominating the scene. The sky is a deep blue with wispy white clouds scattered throughout. Overall, Desert Tourists is a beautiful and serene painting that captures the wonder and awe of exploring nature\'s vast and varied landscapes.', 30.00, '30', 'S5D2009', 'approved', 0, 100, '1677182903.jpg', NULL, 5, 6, '2023-02-23 20:08:23', '2023-02-23 20:08:23', 3),
(160, 'Brush Strokes', 'brush-strokes', ' A colorful abstract painting with multiple brush strokes.', 'Brush Strokes is an abstract painting with a lively and colorful composition. The painting features multiple brush strokes in various colors, creating a dynamic and vibrant atmosphere. The artist has used a variety of brush sizes to create different textures and patterns, adding depth and complexity to the piece. The painting is a celebration of the artistic process, showcasing the beauty of brush strokes and the movement of color on the canvas.', 30.00, '30', 'S5D2010', 'approved', 0, 100, '1677183198.jpg', NULL, 5, 4, '2023-02-23 20:13:18', '2023-02-23 20:13:18', 3),
(161, 'Abstract Eyes', 'abstract-eyes', 'A multi-color painting with a complex arrangement of brushstrokes that forms an abstract eye-like feature.', 'Abstract Eye is a painting that features a complex arrangement of brushstrokes and colors, forming an abstract eye-like feature in the center of the painting. The use of multiple brushes and colors creates a dynamic and vibrant effect, with hues of blue, green, yellow, red, and purple blending together in intricate patterns. The overall effect is both mesmerizing and thought-provoking, leaving the viewer to interpret the meaning behind the abstract image.', 30.00, '30', 'S4D2010', 'approved', 0, 100, '1677183296.jpg', NULL, 3, 4, '2023-02-23 20:14:56', '2023-02-23 20:14:56', 3);
